import React from 'react';
import RenderLineChart from './RenderLineChart.js'

import station_id_key from "./data/station_id_key.json"


const arr = [
            {name: "marko", id:1}, 
            {name:"anna", id : 2}
]
const arr2 = [
            {name: "marko2", id:1}, 
            {name:"anna2", id : 2}
]

function App() {

  const ListItems = ({arr}) => (arr.map(obj => <li>{obj.name}</li>))

const SelectItems = () => (<select>station_id_key.map(obj =>
  <option value = {obj.gtfs}>{obj.station_lines}</option>
  )</select>)

  return (
    <div className="App">
      <SelectItems />
    <RenderLineChart />
     <ListItems arr = {arr2}/>
     Hi world
    </div>
  );
}

export default App;
